import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import './App.css';
import Welcome from './Pages/Welcome';
import Register from './Pages/Register';
import Header from './Navigation/Header';

const App = () => {
  return (
    <React.Fragment>
      <Header />
      <Router>
        <Route path="/" exact>
          <Welcome />
        </Route>
        <Route path="/Register">
          <Register />
        </Route>
      </Router>
    </React.Fragment>
  );
}

export default App;
